import React, { useEffect, useState } from 'react';

function Home() {
    const [message, setMessage] = React.useState("");

    useEffect(() => {
        fetch('http://localhost:3000/api')
            .then(response => response.text())
            .then(data => setMessage(data))
            .catch(error => console.error('Error:', error));
    }, []);

    return (
        <div>
            <h1>Home Page</h1>
            <p>{message}</p>
        </div>
    );
}
export default Home;
